INSERT INTO `wp_posts` VALUES (25,1,'2024-04-22 15:39:24','2024-04-22 15:39:24','<!-- wp:group {\"tagName\":\"main\",\"className\":\"is-style-group-full\",\"layout\":{\"type\":\"flex\",\"flexWrap\":\"nowrap\"}} -->\n<main class=\"wp-block-group is-style-group-full\"><!-- wp:group {\"tagName\":\"section\",\"className\":\"is-style-group-section\",\"layout\":{\"type\":\"constrained\"}} -->\n<section class=\"wp-block-group is-style-group-section\"><!-- wp:group {\"className\":\"is-style-home-heading\",\"layout\":{\"type\":\"constrained\"}} -->\n<div class=\"wp-block-group is-style-home-heading\"><!-- wp:heading {\"level\":1,\"className\":\"is-style-logo-huge\"} -->\n<h1 class=\"wp-block-heading is-style-logo-huge\">man/one music</h1>\n<!-- /wp:heading -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"verticalAlignment\":\"stretch\",\"className\":\"is-style-column-full\"} -->\n<div class=\"wp-block-column is-vertically-aligned-stretch is-style-column-full\"><!-- wp:heading {\"style\":{\"layout\":{\"selfStretch\":\"fit\",\"flexSize\":null}}} -->\n<h2 class=\"wp-block-heading\">music &amp; sound design</h2>\n<!-- /wp:heading --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"className\":\"is-style-column-full\"} -->\n<div class=\"wp-block-column is-style-column-full\"><!-- wp:heading -->\n<h2 class=\"wp-block-heading\">amsterdam / 2024</h2>\n<!-- /wp:heading --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"className\":\"is-style-column-full\"} -->\n<div class=\"wp-block-column is-style-column-full\"></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div>\n<!-- /wp:group -->\n\n<!-- wp:columns {\"className\":\"is-style-columns-full\"} -->\n<div class=\"wp-block-columns is-style-columns-full\"><!-- wp:column {\"verticalAlignment\":\"center\",\"className\":\"is-style-default\"} -->\n<div class=\"wp-block-column is-vertically-aligned-center is-style-default\"><!-- wp:paragraph {\"style\":{\"layout\":{\"selfStretch\":\"fit\",\"flexSize\":nu